import React from "react";
import Post from "./Post";
import PostWrapperStyled from "../styled/mainStyled/PostWrapperStyled";
import { Routes, Route } from "react-router-dom";
const Content = () => {
  return (
    <PostWrapperStyled>
      <Routes>
        <Route path="/" element={<Post />} />
      </Routes>
    </PostWrapperStyled>
  );
};

export default Content;
